!(function (t) {

    $('.question-list li').unbind('click').bind('click', function (e) {
        var question_no = $(this).html();
        $(".question-step").css({display: "none"}).hide().animate({opacity: 0})
        $(".question-step.question-step-" + question_no).css({display: "block"}).show().animate({opacity: 1})
    });

    "use strict";
    jQuery().startTimer &&
            t(".timer").startTimer({
        onComplete: function (i) {
            i.addClass("text-danger"), t(".quiz-form form").trigger("submit");
        },
    });
    var i,
            o,
            e,
            n,
            s = 1;
    function a() {
        var i = t(".js-quiz-question-count").val();
        s >= i ? t(".next").prop("disabled", !0) : t(".next").prop("disabled", !1), s <= 1 ? t(".previous").prop("disabled", !0) : t(".previous").prop("disabled", !1);
    }
    t("body").on("click", ".next", function () {
        (i = t(".question-step-" + s)),
                (o = t(".question-step-" + (s + 1))).length < 1 ||
                (o.show(),
                        i.animate(
                                {opacity: 0},
                                {
                                    step: function (t) {
                                        (n = 1 - t), i.css({display: "none", position: "relative"}), o.css({opacity: n});
                                    },
                                    duration: 600,
                                }
                        ),
                        (s += 1),
                        a());
    }),
            t("body").on("click", ".previous", function () {
        (i = t(".question-step-" + s)),
                (e = t(".question-step-" + (s - 1))).length < 1 ||
                (e.show(),
                        i.animate(
                                {opacity: 0},
                                {
                                    step: function (t) {
                                        (n = 1 - t), i.css({display: "none", position: "relative"}), e.css({opacity: n});
                                    },
                                    duration: 600,
                                }
                        ),
                        s--,
                        a());
    });






    var totalSeconds = 0;
    var focusOut = false;
    setInterval(setTime, 1000);
    function setTime() {
        if (!focusOut) {
            ++totalSeconds;
            $('.t-minute').html(pad(parseInt(totalSeconds / 60)) + '<em>m</em>');
            $('.t-seconds').html(pad(totalSeconds % 60) + '<em>s</em>');
            $(".range-price").attr('data-time_elapsed', totalSeconds);
        }
    }

    function pad(val) {
        var valString = val + "";
        if (valString.length < 2) {
            return "0" + valString;
        } else {
            return valString;
        }
    }
    window.addEventListener('blur', function () {
        var attempt_id = $(".question-area .question-step").attr('data-qattempt');
        jQuery.ajax({
            type: "POST",
            url: '/panel/ajax/helper',
            headers: {
                'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
            },
            data: {"attempt_id": attempt_id, "action": 'attempt_status', 'focus_status': 'out'},
            success: function (return_data) {
                console.log(return_data);
            }
        });

        focusOut = true;
    });

    window.addEventListener('focus', function () {
        var attempt_id = $(".question-area .question-step").attr('data-qattempt');
        jQuery.ajax({
            type: "POST",
            url: '/panel/ajax/helper',
            headers: {
                'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
            },
            data: {"attempt_id": attempt_id, "action": 'attempt_status', 'focus_status': 'in'},
            success: function (return_data) {
                console.log(return_data);
            }
        });
        focusOut = false;
    });


















    var r = {autoplay: !1, preload: "auto"},
    p = t(".video-js");
    p.length &&
            p.each(function (i) {
                var o = p[i],
                        e = t(o).attr("id");
                videojs(e, r);
            });




})(jQuery);




